import Elementos from './Elementos'
import Style from './NaviBar.module.css'
function NaviBar() {
    return (
        <div className={Style.Geral}>
            <Elementos link="/" texto="Login" />
            <Elementos link="/corretoras" texto="Corretoras" />
        </div>
    )
}
export default NaviBar
